import React, { createContext, useEffect, useState } from 'react';
import axios from 'axios';

export const forFiveTelAvivContext = createContext([]);


export default function ForFiveTelAvivContext(props) {
    const [weatherToDays, setWeatherToDays] = useState([]);
    useEffect(() => {
        axios.get('http://dataservice.accuweather.com/forecasts/v1/daily/5day/215854?apikey=uhtrRSo6CDxLgAFlBtnEZh2wWkRANgZf&metric=true')
            .then((data) => {
                debugger;
                setWeatherToDays(data.data.DailyForecasts);
                debugger;
            })
    }, []);
    return (
        <forFiveTelAvivContext.Provider value={weatherToDays}>
            {props.children}
        </forFiveTelAvivContext.Provider>
    )
}
